import React from "react";
import Tables from "./components/Tables";
import { Router, Route, Switch } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <Router>
      <Route path="/:id" component={Tables}></Route>
    </Router>
  );
}

export default App;
